import { 
    SIGN_IN, 
    SIGN_OUT,
} from './types';

const admin = '108677919013990968799'

export const signIn = (userId) => {
    if(userId === amin)
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: true
        }
    else
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: false
            }
};

export const signOut = () => {
    return {
        type: SIGN_OUT
    };
};
